import { makeStyles } from "@material-ui/core/styles";

export const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  headDataItem: {
    fontSize: theme.typography.h4.fontSize,
    textAlign: "center",
  },
  logo: {
    width: "50px",
  },
  bkgColor: {
    background: theme.palette.background.paper,
  },
}));
